contracts/MultiSigWallet1.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.7;

contract MultiSigWallet1 {
    event Deposit(address sender, uint amount);
    event Submit(uint txId);
    event Approve(address owner,uint txId);
    event Excute(address owner,uint txId);
    event Revoke(address owner,uint txId);

    address[] public owners;
    mapping (address => bool) ownerOf;
    Transaction[] public transactions;
    uint public required;
    mapping(uint => mapping (address => bool)) approved;
    

    struct Transaction{
        address to;
        uint value;
        bytes data;
        bool excuted;
    }
 

    modifier onlyOwner(){
        require(ownerOf[msg.sender],"only owner can do this operation");
        _;
    }

    modifier trxExists(uint txId){
        require(txId < transactions.length, "tx not exists");
        _;
    }

    modifier notApproved(uint txId){
        require(!approved[txId][msg.sender], "tx already approved");
        _;
    }

    modifier notExcuted(uint txId){
        require(!transactions[txId].excuted, "tx already excuted");
        _;
    }

    constructor(address[] memory _owners,uint _required) {
        require(_owners.length > 0,"owners must be greater than 0 ");
        require(
            _required > 0 && _required <=  _owners.length,
            "_required num invalid"
        );

        for (uint i; i <= _owners.length - 1; i++) {
            address owner = _owners[i];
            require(owner != address(0),"invalid address");
            require(!ownerOf[owner], "owner is not unique");
            ownerOf[owner] = true;
            owners.push(owner);
        }
        required = _required;
    }

    receive() external payable {
        emit Deposit(msg.sender,msg.value);
    }

    function submit(address _to, uint _value, bytes calldata _data)external onlyOwner{
       transactions.push(Transaction(
            {
                to:_to,
                value:_value,
                data:_data,
                excuted:false
            }
       ));
        emit Submit(transactions.length - 1);
    }

    function approve(uint txId) external onlyOwner trxExists(txId) notApproved(txId) notExcuted(txId) {
        approved[txId][msg.sender] = true;
        emit Approve(msg.sender,txId);
    }

    function _getApprovalCount(uint txId) private view returns (uint count){
        for (uint i; i < owners.length; i++) {
            if(approved[txId][owners[i]]){
                count += 1;
            }
        }
    }

    function excute(uint txId) external trxExists(txId) notExcuted(txId){
        require(_getApprovalCount(txId) >= required,"approvals < required");
        Transaction storage transaction = transactions[txId];
        transaction.excuted = true;

        (bool success,) = transaction.to.call{value:transaction.value}(
            transaction.data
        );
         
        require(success,"excute fail");
        emit Excute(msg.sender,txId);
         
    }

    function revoke(uint txId)external onlyOwner trxExists(txId) notExcuted(txId) {
        require(approved[txId][msg.sender], "tx not approved");
        approved[txId][msg.sender] = false;
        emit Revoke(msg.sender, txId);
    }
}

